import React from "react";
import {BrowserRouter,Route} from "react-router-dom";
import App from "./App";

const appRouter = () =>{
    <BrowserRouter>
        <div>
            <Route path = "/" exact component={App}/>
        </div>
    </BrowserRouter>
}

export default appRouter;
